import './Skills.css';
import Lottie from 'react-lottie';
import techStack from './tech-stack.json'; 


function Skills(){
    return(
        <div className='skills-wrapper'>
            <section>
                <div className='skills-header'>
                    <hr></hr>
                    <h1>Skills</h1>
                </div>
                <div className='skills-container'>
                    <div className='skills-content'>
                        <h1>What can I do?</h1>
                        <p>
                            I have the basics fundamenals of programming. I have known a variety of programming languages and have a basic knowledge on it. The following are some of the important languages and tools in which I have learned:
                        </p>
                    </div>
                    <div className='animation-container'>
                        <AnimationComponent/>
                    </div>
                </div>
            </section>
        </div>
    );
}
const AnimationComponent = () => {
    const defaultOptions = {
      loop: true,
      autoplay: true,
      animationData: techStack,
      rendererSettings: {
        preserveAspectRatio: 'xMidYMid slice'
      }
    };
  
    return <Lottie options={defaultOptions} />;
};

export default Skills
